let time = 0;

this.rotation.order = "XZY";

function update( event ) {

	time += 1;

	this.rotation.x = -(Math.PI*2)*0.1;

	this.rotation.z = Math.sin(time*0.001)*0.2;

	this.rotation.y = Math.sin(time*0.005)
}

